CREATE DATABASE IF NOT EXISTS `contactsaddressesbdd`;
USE `contactsaddressesbdd`;
CREATE TABLE IF NOT EXISTS `ContactModel` (
  `uuid` VARCHAR(1024),
  `name` VARCHAR(1024),
  `first_name` VARCHAR(1024),
  `email` VARCHAR(1024),
  `personal_phone` BIGINT,
  `function` VARCHAR(1024),
  `work_phone` BIGINT
);


CREATE TABLE IF NOT EXISTS `AddressModel` (
  `uuid` VARCHAR(1024),
  `number` BIGINT,
  `street` VARCHAR(1024),
  `postal_code` BIGINT,
  `city` VARCHAR(1024),
  `country` VARCHAR(1024),
  `address_complement` VARCHAR(1024),
  `additional_information` VARCHAR(1024)
);

